export const initialState = {
  basket: ["Arslan", "Ifra"],
};

function reducer(state, action) {
  switch (action.type) {
    case "ADD_To_BASKET":
      break;
    case "REMOVE_FROM_BASKET":
      break;
    default:
      return state;
  }
}

export default reducer;
